import React, { Component } from "react";

class Navbar extends Component {

  render() {

  return (
        <nav style={{ backgroundColor: "#000080", color: "white" }}>
            <div style={{ fontFamily: "Open Sans", padding: "15px"}}><h3><b>Patrick Kennedy</b></h3></div>
            <ul style={{ fontFamily: "Open Sans" }} class="nav justify-content-center">
            <li class="nav-item">
                <a style={{ color: "white" }} class="nav-link active" href="/resume">Resume</a>
            </li>
            <li class="nav-item">
                <a style={{ color: "white" }} class="nav-link" href="/aboutme">About Me</a>
            </li>
            <li class="nav-item">
                <a style={{ color: "white" }} class="nav-link" href="projects">Projects</a>
            </li>
            </ul>
        </nav>
      ) 
    }
  }

export default Navbar;
